import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';
import Box3 from './App';
import reportWebVitals from './reportWebVitals';

const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);


root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();

function renderBox3() {
  const box3Element = document.getElementById("Box3"); // Box3 아이디를 가진 요소를 찾음
  if (box3Element) {
    ReactDOM.render(
      <React.StrictMode>
        <Box3 /> {/* Box3 컴포넌트를 렌더링 */}
      </React.StrictMode>,
      box3Element // Box3 아이디를 가진 요소 안에 렌더링
    );
  }
}

// 페이지가 로드될 때 renderBox3 함수 실행
document.addEventListener("DOMContentLoaded", renderBox3);
